import la from '../../resources/images/logos/la.png'
import paris from '../../resources/images/logos/paris.png'
import milano from '../../resources/images/logos/m'





const nextOlympicsGamesNext = () => {
    return (
        <section id="next_olympic">
                <a class='next_olympic' href="https://olympics.com/en/beijing-2022/schedule-by-sport/alpine-skiing/" target="_blank" > <img  src={brisbane} ></img></a>   
                <a class='next_olympic' href="https://olympics.com/en/beijing-2022/schedule-by-sport/biathlon/" target="_blank" > <img  src={la} ></img></a>   
                <a class='next_olympic' href="https://olympics.com/en/beijing-2022/schedule-by-sport/bobsleigh/" target="_blank" > <img  src={paris} ></img></a>                 
                <a class='next_olympic' href="https://olympics.com/en/beijing-2022/schedule-by-sport/cross-country-skiing/" target="_blank" > <img  src={CrossCountrySkiing}></img></a>

        </section>
    )
};
export default nextOlympicsGamesNext;
